    public Syncfusion.Blazor.Diagram.DiagramPoint GetNodeAnnotationOffset(string Value)
    {
        Syncfusion.Blazor.Diagram.DiagramPoint Offset;
        switch (Value)
        {
            case "TopLeft":
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 0, Y = 0 };
                break;
            case "TopCenter":
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 0.5, Y = 0 };
                break;
            case "TopRight":
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 1, Y = 0 };
                break;
            case "MiddleLeft":
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 0, Y = 0.5 };
                break;
            case "MiddleRight":
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 1, Y = 0.5 };
                break;
            case "BottomLeft":
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 0, Y = 1 };
                break;
            case "BottomCenter":
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 0.5, Y = 1 };
                break;
            case "BottomRight":
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 1, Y = 1 };
                break;
            default:
                Offset = new Syncfusion.Blazor.Diagram.DiagramPoint() { X = 0.5, Y = 0.5 };
                break;
        }
        return Offset;
    }

    public string GetNodeTextPositionValue(Syncfusion.Blazor.Diagram.DiagramPoint Offset)
    {
        string Position = "Center";
        switch (Offset.Y) {
            case 0:
                switch (Offset.X)
                {
                    case 0:
                        Position = "TopLeft";
                        break;
                    case 0.5:
                        Position = "TopCenter";
                        break;
                    case 1:
                        Position = "TopRight";
                        break;
                }
                break;
            case 0.5:
                switch (Offset.X)
                {
                    case 0:
                        Position = "MiddleLeft";
                        break;
                    case 0.5:
                        Position = "Center";
                        break;
                    case 1:
                        Position = "MiddleRight";
                        break;
                }
                break;
            case 1:
                switch (Offset.X)
                {
                    case 0:
                        Position = "BottomLeft";
                        break;
                    case 0.5:
                        Position = "BottomCenter";
                        break;
                    case 1:
                        Position = "BottomRight";
                        break;
                }
                break;
        }
        return Position;
    }

    public double GetConnectorAnnotationOffset(string Value)
    {
        double Offset;
        switch (Value)
        {
            case "Before":
                Offset = 0;
                break;
            case "Center":
                Offset = 0.5;
                break;
            case "After":
                Offset = 1;
                break;
            default:
                Offset = 0.5;
                break;
        }
        return Offset;
    }

    public string GetConnectorTextPositionValue(double Offset)
    {
        string Position;
        switch (Offset) {
            case 0:
                Position = "Before";
                break;
            case 0.5:
                Position = "Center";
                break;
            case 1:
                Position = "After";
                break;
            default:
                Position = "Center";
                break;
        }
        return Position;
    }


