    public async Task OnUpdateDiagramProperties(string prop, string Value)
    {
        SfDiagramComponent Diagram = Parent.DiagramContent.Diagram;
        Diagram.BeginUpdate();
        if (!PreventPropertyChange)
        {
            switch (prop)
